import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { BrowserRouter, Route } from "react-router-dom"
import Header from './Header';
import Book from './Book';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Book />
        <Route path='/add' element={Book}></Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
